    "series-of-aerial-images-over-quivira-national-wildlife-refuge-acquired-september-1950",nt"isopen":
    false,nt"url": null,nt"notes": "This data set is composite of original
    black and white series images obtained from Earth Explorer (USGS) on September 23rd,
    1950.  The original photos were georeferenced against Stafford County NAIP (2012)
    imagery.  It represents the refuge landscape 5 years prior to the establishment
    of Quivira National Wildlife Refuge.  This image allows a great look back in time
    to interpret habitat types and land use patterns.  These changes and others (extent
    of woody vegetation) can be made from this image using current imagery for comparison.
    This image, and others, are being used by refuge staff to assist in understanding
    and visualizing the historical content of the lands within the refuge and how they
    have changed over the last 80 years. Individual frames from this mosaiced image
    are available and are stored at the Region 6 Regional Office.  Pixel resolution
    of this image is  1.3 meters. This image should be used for resource-level interpretation
    only.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
